package com.xinyan.mms.materials.pojo;/** * 仓库表 */public class Tab_Warehouse {    private int store_coding;    private String materials_coding;    private String store_name;    private String warehouse_warningvalue;    private String warehouse_stockquantity;    private String warehouse_remark;    public int getStore_coding() {        return store_coding;    }    public void setStore_coding(int store_coding) {        this.store_coding = store_coding;    }    public String getMaterials_coding() {        return materials_coding;    }    public void setMaterials_coding(String materials_coding) {        this.materials_coding = materials_coding;    }    public String getStore_name() {        return store_name;    }    public void setStore_name(String store_name) {        this.store_name = store_name;    }    public String getWarehouse_warningvalue() {        return warehouse_warningvalue;    }    public void setWarehouse_warningvalue(String warehouse_warningvalue) {        this.warehouse_warningvalue = warehouse_warningvalue;    }    public String getWarehouse_stockquantity() {        return warehouse_stockquantity;    }    public void setWarehouse_stockquantity(String warehouse_stockquantity) {        this.warehouse_stockquantity = warehouse_stockquantity;    }    public String getWarehouse_remark() {        return warehouse_remark;    }    public void setWarehouse_remark(String warehouse_remark) {        this.warehouse_remark = warehouse_remark;    }}